import React from 'react';
var images = require.context('../../assets/images', true);

class ImageD extends React.Component {
    render() {
        let img_src = images(`./icons/effect-${this.state.effect}.jpg`)
        return (
            <img src={img_src} alt=""/>
        );
    }
}
